import React from 'react';
import { StyleSheet, Text, View, Button } from 'react-native';

export default class Recette extends React.Component {
  render(){
    return (
      <View style={styles.container}>
        <Text>Vos recettes</Text>
        <Text>
        <p><strong>Toutes les recettes du bateau de Thibault</strong></p>
        <p>06.55.66.77.88</p>
        <p>addr@hotmail.com</p>
        <p>www.facebookThibault.com</p>
        </Text>
        <Button title="Homard">Homard</Button>
        <Button title="St Jacque">St Jacque</Button>
        <Button title="Bar">Bar</Button>
        <Button title="Tourteau">Tourteau</Button>
        <Button title="Recette">Recette</Button>
        <Button title="Recette2">Recette</Button>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
